import React, { Component } from 'react';

export default class Ranking extends Component {
  render() {
    return (<div data-testid="ranking-title">
      <button
        onClick={ () => {
          const { history, dispatch } = this.props;
          dispatch(questionIndex(0));
          history.push('/');
        } }
        type="button"
        data-testid="btn-go-home"
      >
        Play Again
      </button>
      Ranking
    </div>);
  }
}
